import EthLogo from './eth_logo.svg';


const HomeWrap = () => {
  return (
    <div class="container">
      <div class="row">
        <div class="col-5"><h1><b>Welcome page heere, text is WETH</b></h1></div>
        <div class="col-6">      <img src={EthLogo} alt="React Logo" />
</div>
        <div class="col"></div>
      </div>
    </div>
  );
};

export default HomeWrap;
